import React from 'react';

import '../card/card.styles.css';

export const CatCard = props => (
  console.log(props),
  <div className='card-container'>
    <h2> {props.cat.id} </h2>
    <h2> {props.cat.name} </h2>
    {/* <p> {props.description} </p> */}
  </div>
);
